fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1448346","type":"CustomJS"},{"attributes":{},"id":"1448212","type":"BasicTicker"},{"attributes":{"coordinates":null,"data_source":{"id":"1448191"},"glyph":{"id":"1448233"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1448235"},"nonselection_glyph":{"id":"1448234"},"view":{"id":"1448237"}},"id":"1448236","type":"GlyphRenderer"},{"attributes":{"overlay":{"id":"1448182"}},"id":"1448177","type":"BoxZoomTool"},{"attributes":{"source":{"id":"1448191"}},"id":"1448267","type":"CDSView"},{"attributes":{"axis":{"id":"1448211"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1448214","type":"Grid"},{"attributes":{},"id":"1448277","type":"BasicTickFormatter"},{"attributes":{"line_color":"#1f77b4","line_width":1.3,"x":{"field":"index"},"y":{"field":"ebsw(C)_0_1"}},"id":"1448323","type":"Line"},{"attributes":{"coordinates":null,"formatter":{"id":"1448197"},"group":null,"major_label_policy":{"id":"1448280"},"ticker":{"id":"1448168"},"visible":false},"id":"1448167","type":"LinearAxis"},{"attributes":{"coordinates":null,"formatter":{"id":"1448277"},"group":null,"major_label_policy":{"id":"1448278"},"ticker":{"id":"1448172"}},"id":"1448171","type":"LinearAxis"},{"attributes":{"source":{"id":"1448242"}},"id":"1448248","type":"CDSView"},{"attributes":{"coordinates":null,"data_source":{"id":"1448242"},"glyph":{"id":"1448244"},"group":null,"hover_g
